import{ Routes, Route } from 'react-router-dom';
import { Main } from './main/Main';
import './App.css';
// import { CountryPage } from './page/CountryPage';

function App() {
  return (


    <div className="App">

    <Routes> 
     <Route path="/" element={<Main />}>
      <Route path="/:name" element={<IndividualPage/>}>

      </Route>
        </Route>
   </Routes> 

    </div>


  );
}

export default App;
